DROP TABLE IF EXISTS `aowow_itemset`;

CREATE TABLE `aowow_itemset` (
  `itemsetID` smallint(3) NOT NULL,
  `name_loc0` varchar(255) DEFAULT NULL,
  `item1` mediumint(11) DEFAULT NULL,
  `item2` mediumint(11) DEFAULT NULL,
  `item3` mediumint(11) DEFAULT NULL,
  `item4` mediumint(11) DEFAULT NULL,
  `item5` mediumint(11) DEFAULT NULL,
  `item6` mediumint(11) DEFAULT NULL,
  `item7` mediumint(11) DEFAULT NULL,
  `item8` mediumint(11) DEFAULT NULL,
  `item9` mediumint(11) DEFAULT NULL,
  `item10` mediumint(11) DEFAULT NULL,
  `spell1` mediumint(5) DEFAULT NULL,
  `spell2` mediumint(5) DEFAULT NULL,
  `spell3` mediumint(5) DEFAULT NULL,
  `spell4` mediumint(5) DEFAULT NULL,
  `spell5` mediumint(5) DEFAULT NULL,
  `spell6` mediumint(5) DEFAULT NULL,
  `spell7` mediumint(5) DEFAULT NULL,
  `spell8` mediumint(5) DEFAULT NULL,
  `bonus1` tinyint(1) DEFAULT NULL,
  `bonus2` tinyint(1) DEFAULT NULL,
  `bonus3` tinyint(1) DEFAULT NULL,
  `bonus4` tinyint(1) DEFAULT NULL,
  `bonus5` tinyint(1) DEFAULT NULL,
  `bonus6` tinyint(1) DEFAULT NULL,
  `bonus7` tinyint(1) DEFAULT NULL,
  `bonus8` tinyint(1) DEFAULT NULL,
  `skillID` smallint(3) DEFAULT NULL,
  `skilllevel` smallint(3) DEFAULT NULL,
  `classes` varchar(5) DEFAULT NULL,
  `note` tinyint(2) DEFAULT NULL,
  `heroic` tinyint(2) DEFAULT 0,
  PRIMARY KEY (`itemsetID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;


